import { render } from '@testing-library/react';
import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <h2>The Main Heading</h2>
        <p>Edit <code>src/App.js</code> and save to reload.</p>
      </div>
    )
  };
}

export default App;
